import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { fetchTableHTML } from '../api/api';

const NormalizedTableView = () => {
  const { tableName } = useParams();
  const navigate = useNavigate();
  const [tableHTML, setTableHTML] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadTable = async () => {
      try {
        const html = await fetchTableHTML(tableName);
        setTableHTML(html);
      } catch (err) {
        setTableHTML('<p>Error loading table.</p>');
      } finally {
        setLoading(false);
      }
    };
    loadTable();
  }, [tableName]);

  return (
    <div className="table-view-page">
      <button className="back-button" onClick={() => navigate('/')}>
        ðŸ”™ Back to Workflow
      </button>

      <h2>Table: {tableName}</h2>
      {loading ? <p>Loading...</p> : <div dangerouslySetInnerHTML={{ __html: tableHTML }} />}
    </div>
  );
};

export default NormalizedTableView;
